import React from 'react';
import "./Header.css";
import { IconButton } from '@mui/material';
import PersonIcon from '@mui/icons-material/Person';
function Header() {
    return (
        <div className="header">
            <IconButton>
            <PersonIcon fontSize='large' className='header__icon' />
            </IconButton>

            <img className='header__logo'
            src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.logo.wine%2Flogo%2FTinder_%2528app%2529&psig=AOvVaw3iujLKkZMof6mQTnu014ZQ&ust=1684775282771000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCKjfrZTzhv8CFQAAAAAdAAAAABAE'
            />
        </div>
    )
}
export default Header;
